import Logo from './Logo';
import { colors, fonts } from '../shared/styles';

export default function PageTitle() {
  return (
    <header>
      <Logo color="amber" />
      <h1>
        <span>Christ the King</span>
        <span>Anglican Church</span>
      </h1>
      <hr />
      <style jsx>{`
        header {
          color: white;
          height: 100vh;
          padding: 20px;
          padding-top: 30vh;
          position: relative;
          text-align: center;
          z-index: 3;
        }

        h1 {
          font-family: ${fonts.serif};
          line-height: 1.1;
          padding: 30px 0;
        }

        hr {
          width: 40%;
          border: none;
          border-bottom: 4px solid ${colors.amber};
        }

        span {
          display: block;
        }
      `}</style>
    </header>
  )
}
